n this page (assumed).\";s:7:\"noindex\";s:48:\"Prevents search engines from indexing this page.\";s:8:\"nofollow\";s:58:\"Prevents search engines from following links on this page.\";s:9:\"noarchive\";s:69:\"Prevents cached copies of this page from appearing in search results.\";s:9:\"nosnippet\";s:82:\"Prevents descriptions from appearing in search results, and prevents page caching.\";s:5:\"noodp\";s:114:\"Blocks the <a href=\"http://www.dmoz.org/\">Open Directory Project</a> description from appearing in search results.\";s:6:\"noydir\";s:99:\"Prevents Yahoo! from listing this page in the <a href=\"http://dir.yahoo.com/\">Yahoo! Directory</a>.\";s:12:\"noimageindex\";s:57:\"Prevent search engines from indexing images on this page.\";s:11:\"notranslate\";s:78:\"Prevent search engines from offering to translate this page in search results.\";}}s:4:\"name\";s:6:\"robots\";}s:13:\"news_keywords\";a:6:{s:5:\"label\";s:20:\"Google News Keywords\";s:11:\"description\";s:196:\"A comma-separated list of keywords about the page. This meta tag is used as an indicator in <a href=\"http://support.google.com/news/publisher/bin/answer.py?hl=en&amp;answer=68297\">Google News</a>.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:6;s:4:\"name\";s:13:\"news_keywords\";}s:8:\"standout\";a:6:{s:5:\"label\";s:15:\"Google Standout\";s:11:\"description\";s:282:\"Highlight standout journalism on the web, especially for breaking news; used as an indicator in <a href=\"https://support.google.com/news/publisher/answer/191283?hl=en&amp;ref_topic=2484650\">Google News</a>. Warning: Don\'t abuse it, to be used a maximum of 7 times per calendar week!\";s:5:\"class\";s:17:\"DrupalTextMetaTag\";s:5:\"group\";s:8:\"advanced\";s:6:\"weight\";i:7;s:4:\"name\";s:8:\"standout\";}s:6:\"rating\";a:8:{s:5:\"label\";s:14:\"Content rating\";s:11:\"description\";s:55:\"Used to indicate the intended audience for the content.\";s:5:\"class\";s:17:\"DrupalTextMetaTag\